import {makeStyles} from "@material-ui/core/styles";

export const useStyles = makeStyles(theme => {
    console.log(theme.mixins.toolbar)
    return {
        toolbar: theme.mixins.toolbar,
        fixedToolbar: '16px',
        content: {
            flexGrow: 1,
            display: 'flex',
            flexDirection: 'column',
            padding: '0 16px',
        },
    }
});
